import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div className="text-center">
      <h1 className="mb-4">Welcome to Our Platform</h1>
      <Link to="/signup" className="btn btn-primary btn-lg">
        Create Account
      </Link>
    </div>
  );
}

export default Home;
